import React from "react";
import './style.css';
import Card from "../Card";
import { getDefaultNormalizer } from "@testing-library/react";

const SideBar = props => {
    return (
        <div className = "sidebarContainer">
            <Card>
                <div className = "cardHeader">
                    <span>Contents</span>
                </div>
                <div className = "cardContents">
                    <div className = "postTitle">11 Essay Collections For When A Novel Feels Too Much</div>
                    <br />
                    <div className = "postTitle">40 LGBTQ+ Books To Read Now & Always</div>
                    <br />
                    <div>Detransition, Baby Author Torrey Peters Procrastinates By Reading Moby Dick</div>
                    <br />
                    <div>10 Tips For Hosting A Digital Book Club</div>
                    <br />
                </div>
            </Card>
        </div>
    )
};

export default SideBar;
